import React from "react";
import { Link } from "react-router-dom";
import { useMutation } from "@apollo/client";

import { CREATE_ACCOUNT } from "../queries/mutations";

const Home = () => {
  return (
    <div>
      <Link to="/squares">
        <button>Square</button>
      </Link>
      <Link to="/squares/new">
        <button>new</button>
      </Link>
    </div>
  );
};

export default Home;
